/*
    Update Summary:
    - update `naics_code` table to reflect naics data
    - import "NAICS 2022 Version 1.0" data from https://www23.statcan.gc.ca/imdb/p3VD.pl?Function=getVD&TVD=1369825

    New table looks like this:
    CREATE TABLE naics_code
    (
        naics_code      varchar(255)                        not null,
        naics_year      varchar(255)                        not null,
        naics_label     varchar(255)                        not null,
        naics_code_desc varchar(1023)                       not null,
        effective_date  date      default current_date      not null,
        expiry_date     date,
        create_date     timestamp default current_timestamp not null,
        update_date     timestamp default current_timestamp not null,
        create_user     varchar(255)                        not null,
        update_user     varchar(255)                        not null,
        constraint naics_code_id_pk primary key (naics_code)
    );
*/

-- modify pay_transparency schema only
SET search_path TO pay_transparency;

-- make changes to `naics_code` table's definition
ALTER TABLE naics_code ADD   COLUMN naics_year     varchar(255);    -- Add naics_year
ALTER TABLE naics_code ALTER COLUMN naics_code_desc TYPE varchar(1023);     -- Changle naics_label to support more chars
ALTER TABLE naics_code ALTER COLUMN effective_date TYPE date;       -- Change effective_date to date
ALTER TABLE naics_code ALTER COLUMN effective_date SET DEFAULT current_date; -- Change default of effective_date to current_date
ALTER TABLE naics_code ALTER COLUMN expiry_date    TYPE date;       -- Change expiry_date to date
ALTER TABLE naics_code ALTER COLUMN expiry_date    DROP NOT NULL;   -- Make expiry_date nullable; null means there is no expiry date
ALTER TABLE naics_code ALTER COLUMN expiry_date    DROP DEFAULT;    -- Remove default on expiry_date

-- temp_table to store data from csv (get everything as a string, then convert in final table)
CREATE TEMP TABLE temp_table (
    naics_code varchar(255), 
    naics_year varchar(255), 
    label varchar(255), 
    description varchar(1023), 
    effective_date varchar(255), 
    expiry_date varchar(255));

-- CSV data of "NAICS 2022 Version 1.0" from https://www23.statcan.gc.ca/imdb/p3VD.pl?Function=getVD&TVD=1369825
-- Get data from STDIN (ie. the lines following this command) in temp_table
COPY temp_table FROM STDIN WITH (FORMAT csv, HEADER MATCH, DELIMITER ',');
